import { MicNone } from "@material-ui/icons";
import React from "react";

const SearchResult = ({data}) => {
    return (
    data.map((item) => <div>
      <div className="card search-result-card" style={{display:"flex", flexDirection:"row", justifyContent:"space-between"}}>
        <div style={{display:"flex", flexDirection:"row", justifyContent:"space-between"}}>
          <img className="profileImage rounded-circle" src="https://wallpaperaccess.com/full/2213424.jpg"></img>
          <div> style={{margin}}
            <p style={{textTransform:"capitalize"}}>{item.name}</p>
          </div>
        </div>
        <a href="#" style={{textDecoration:"none", color:"crimson"}}>Follow</a>
      </div>
    </div>)
 );
}

export default SearchResult;
